INSERT INTO `dc_category` (`pkid`, `status`, `sort_order`, `heading`, `heading_cn`, `title`, `title_cn`, `img_url`, `description`, `description_cn`, `created_by`, `created_date`, `updated_by`, `updated_date`) VALUES
(2, 1, 2, 'A Growing Industry - Biometric Energy', 'ä¸€ä¸ªæ­£åœ¨å´›èµ·çš„é¢†åŸŸ â€“ çŽ¯ä¿ç”Ÿç‰©èƒ½æº', 'Biometric Energy', 'çŽ¯ä¿ç”Ÿç‰©èƒ½æº', '582ec5acc0737.jpg', '<div class="\\\\\\" \\\\\\\\\\"editor-content\\\\\\\\\\"\\\\\\""="">\r\n<h4 style="line-height: 150%;"><div style="text-align: center;"><i style="color: inherit; font-family: inherit;"><span style="line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Construction waste generated from\r\ndevelopment project</span></i></div><i><div style="text-align: center;"><i style="color: inherit; font-family: inherit;"><span style="line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">drawn big attention to\r\nenvironmental organization.</span></i></div></i></h4><p class="MsoNormal"><o:p>Â </o:p></p><p class="MsoNormal"><span style="line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">One of the construction material comes\r\nfrom the process of milling of lumber and it usually produce related industrial\r\nwaste. </span><o:p></o:p></p><p class="MsoNormal"><o:p>Â </o:p></p><p class="MsoNormal"><span style="line-height: 115%;">ECO GREEN\r\nWELLBEING HOLDING <span style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="mso-spacerun:yes">Â </span>collect the sawdust and related waste, compact\r\nand compress it into a type of wood pellets that can turn out to outcome of\r\nbiofuels. </span></span><o:p></o:p></p><p class="MsoNormal"><o:p>Â </o:p></p><h4 style="text-align: center; "><span style="line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><i>Biofuels\r\ngenerate less pollution and made from modern biological processes.</i></span>Â </h4><p class="MsoNormal"><o:p>Â </o:p></p><p class="MsoNormal"><span style="line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Wood pellet fuel relatively generate\r\nefficiency energy and low pollution compare to other forms of combustion\r\nheating. Wood pellet is one of the Biometric Energy product that are commonly\r\nused in European Union, and EcoGreen is bringing in as a pioneer enhancing\r\napplication of wood pellet offer one of a better option replacing traditional material\r\nthat produce high pollution. </span><o:p></o:p></p><p class="MsoNormal"><o:p>Â </o:p></p><h4 style="line-height: 150%;"><div style="text-align: center;"><i style="color: inherit; font-family: inherit;"><span style="line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">We are proud to be part of the\r\nmakers for renewable energy, application on</span></i></div><i><div style="text-align: center;"><i style="color: inherit; font-family: inherit;"><span style="line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">wood pellet reduce gas emission\r\ntremendously.</span></i></div><o:p><div style="text-align: center;"><i style="color: inherit; font-family: inherit;"><o:p>Â </o:p></i></div></o:p></i></h4><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>ZH-CN</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\r\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\r\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\r\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val="Cambria Math"></m:mathFont>\r\n   <m:brkBin m:val="before"></m:brkBin>\r\n   <m:brkBinSub m:val="--"></m:brkBinSub>\r\n   <m:smallFrac m:val="off"></m:smallFrac>\r\n   <m:dispDef></m:dispDef>\r\n   <m:lMargin m:val="0"></m:lMargin>\r\n   <m:rMargin m:val="0"></m:rMargin>\r\n   <m:defJc m:val="centerGroup"></m:defJc>\r\n   <m:wrapIndent m:val="1440"></m:wrapIndent>\r\n   <m:intLim m:val="subSup"></m:intLim>\r\n   <m:naryLim m:val="undOvr"></m:naryLim>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="false"\r\n