(3, 1, 3, 'Corporate Social Responsibility - Lumber ', 'ç¤¾ä¼šä¼ä¸šè´£ä»» â€“ æœ¨æ', 'Lumber', 'æœ¨æ', '582ec5c583889.jpg', '<div class="\\&quot;\\\\&quot;\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;editor-content\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\\&quot;\\\\\\\\&quot;\\\\&quot;\\&quot;">\r\n<p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;"><span style="\\&quot;\\\\&quot;\\\\\\\\&quot;font-size:12.0pt;line-height:115%;font-family:\\\\&quot;\\&quot;" calibri;mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\\\\\\\\\\\\\\"="\\&quot;\\\\&quot;\\\\&quot;\\&quot;">Deforestation\r\nis one big concern to our founder. Therefore, founder Datuk Mohd Nor devote\r\ncompany effort by make our company as an arm to saving our environment.</span></p><p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;"><span style="\\&quot;\\\\&quot;\\\\\\\\&quot;font-size:12.0pt;line-height:115%;font-family:\\\\&quot;\\&quot;" calibri;mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\\\\\\\\\\\\\\"="\\&quot;\\\\&quot;\\\\&quot;\\&quot;">Setting\r\nup corporate social responsibility for an entrepreneurial corporation serve a\r\nbig aim. Our CSR aim is to â€˜reforestationâ€™.</span>&nbsp;</p><h4 style="\\&quot;\\\\&quot;\\\\\\\\&quot;text-align:center;line-height:150%\\\\\\\\&quot;\\\\&quot;\\&quot;"><i style="\\&quot;\\\\&quot;\\\\\\\\&quot;mso-bidi-font-style:normal\\\\\\\\&quot;\\\\&quot;\\&quot;"><span style="\\&quot;\\\\&quot;\\\\\\\\&quot;font-size:12.0pt;line-height:\\\\&quot;\\&quot;" 150%;font-family:calibri;mso-fareast-font-family:calibri;mso-bidi-font-family:="\\&quot;\\\\&quot;\\\\&quot;\\&quot;" calibri\\\\\\\\\\\\\\"="\\&quot;\\\\&quot;\\\\&quot;\\&quot;">It is always give and take philosophy,<br></span></i><i style="\\&quot;\\\\&quot;\\\\\\\\&quot;mso-bidi-font-style:normal\\\\\\\\&quot;\\\\&quot;\\&quot;"><span style="\\&quot;\\\\&quot;\\\\\\\\&quot;font-size:12.0pt;line-height:\\\\&quot;\\&quot;" 150%;font-family:calibri;mso-fareast-font-family:calibri;mso-bidi-font-family:="\\&quot;\\\\&quot;\\\\&quot;\\&quot;" calibri\\\\\\\\\\\\\\"="\\&quot;\\\\&quot;\\\\&quot;\\&quot;">taking one tree life away, planting 2 trees back to ground.</span></i></h4><p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;" align="\\&quot;\\\\&quot;\\\\\\\\&quot;center\\\\\\\\&quot;\\\\&quot;\\&quot;" style="\\&quot;\\\\&quot;\\\\\\\\&quot;text-align:center;line-height:150%\\\\\\\\&quot;\\\\&quot;\\&quot;"><o:p></o:p></p><p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;"><span style="\\&quot;\\\\&quot;\\\\\\\\&quot;font-size:12.0pt;line-height:115%;font-family:\\\\&quot;\\&quot;" calibri;mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\\\\\\\\\\\\\\"="\\&quot;\\\\&quot;\\\\&quot;\\&quot;">Take ONE\r\nPlant TWO campaign has been running around for 2 years. As like our founder\r\ndetermined, there is no take for granted for mother nature. Being a developer,\r\nwe take from the nature and we give back to the nature, the ecosystem alive\r\nthen it come to the human race survive.</span></p><h4 style="\\&quot;\\\\&quot;\\\\\\\\&quot;text-align:center;line-height:150%\\\\\\\\&quot;\\\\&quot;\\&quot;"><i style="\\&quot;\\\\&quot;\\\\\\\\&quot;mso-bidi-font-style:normal\\\\\\\\&quot;\\\\&quot;\\&quot;"><span style="\\&quot;\\\\&quot;\\\\\\\\&quot;font-size:12.0pt;line-height:\\\\&quot;\\&quot;" 150%;font-family:calibri;mso-fareast-font-family:calibri;mso-bidi-font-family:="\\&quot;\\\\&quot;\\\\&quot;\\&quot;" calibri\\\\\\\\\\\\\\"="\\&quot;\\\\&quot;\\\\&quot;\\&quot;">Green revolution is not carried out by talking nor speech</span></i></h4><p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;" align="\\&quot;\\\\&quot;\\\\\\\\&quot;center\\\\\\\\&quot;\\\\&quot;\\&quot;" style="\\&quot;\\\\&quot;\\\\\\\\&quot;text-align:center;line-height:150%\\\\\\\\&quot;\\\\&quot;\\&quot;"><o:p></o:p></p><p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;" align="\\&quot;\\\\&quot;\\\\\\\\&quot;center\\\\\\\\&quot;\\\\&quot;\\&quot;" style="\\&quot;\\\\&quot;\\\\\\\\&quot;text-align:center;line-height:150%\\\\\\\\&quot;\\\\&quot;\\&quot;">We\r\nstrongly&nbsp; believe&nbsp; that CSR shall not be a slogan but a real\r\ntruthful action, standing a role model among peer companies and stood up for an\r\nexample to the industry. Creating sustainable livelihood for our community and\r\nsociety is utmost important.</p><p class="\\&quot;\\\\&quot;\\\\\\\\&quot;MsoNormal\\\\\\\\&quot;\\\\&quot;\\&quot;"><o:p></o:p></p>\r\n</div>\r\n<style>\r\n<!--\r\n /* Font Definitions */\r\n@font-face\r\n	{font-family:Arial;\r\n	panose-1:2 11 6 4 2 2 2 2 2 4;\r\n	mso-font-charset:0;\r\n	mso-generic-font-family:auto;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-536859905 -1073711037 9 0 511 0;}\r\n@font-face\r\n	{font-family:\\\\\\\\\\\\\\"Cambria Math\\\\\\\\\\\\\\";\r\n	panose-1:2 4 5 3 5 4 6 3 2 4;\r\n	mso-font-charset:1;\r\n	mso-generic-font-family:roman;\r\n	mso-font-format:other;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:0 0 0 0 0 0;}\r\n@font-face\r\n	{font-family:Calibri;\r\n	panose-1:2 15 5 2 2 2 4 3 2 4;\r\n	mso-font-charset:0;\r\n	mso-generic-font-family:auto;\r\n	mso-font-pitch:variable;\r\n	mso-font-signature:-536870145 1073786111 1 0 415 0;}\r\n /* Style Definitions */\r\np.MsoNormal, li.MsoNormal, div.MsoNormal\r\n	{mso-style-unhide:no;\r\n	mso-style-parent:\\\\\\\\\\\\\\"\\\\\\\\\\\\\\";\r\n	margin:0cm;\r\n	margin-bottom:.0001pt;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:Arial;\r\n	mso-fareast-font-family:Arial;\r\n	color:black;}\r\n.MsoChpDefault\r\n	{mso-s