INSERT INTO `dc_time` (`pkid`, `status`, `cat_pkid`, `sort_order`, `title`, `title_cn`, `description`, `description_cn`, `created_by`, `created_date`, `updated_by`, `updated_date`) VALUES
(1, 1, 1, 1, 'In Betong, a touch of nature is easily seen and felt. ', 'åœ¨å‹¿æ´žï¼Œä½ å¯ä»¥è½»æ˜“åœ°æ„Ÿå—åˆ°è‡ªç„¶ç¾Žè§‰ã€‚', '<p class="MsoNormal" style="line-height: 16.8667px;">There are always mist enveloping the mountains where surrounding the township, the serenity with swifts flying over the skyline gives a piece of silent, the warm and friendly ambience among different communities, all of these amazing element has shaped BETONG a nice and heart-warmth town.&nbsp;</p><p class="MsoNormal" style="line-height: 16.8667px;">A large area of old jungle has covered most of the outskirt area near BETONG, gradually rising tourism activities fame up the township and turn the township into touristsâ€™ favorite spot.</p><p class="MsoNormal" style="line-height: 16.8667px;">In 2014, ECO GREEN WELLBEING HOLDING &nbsp;oversaw a cooperative venture between the company and governor of Ya La Province, Thailand. The company is selected by the province to develop a conceptualized green city, THE GREEN ECO GARDEN CITY. Hence, BETONG become the ideal location for ECOGREEN to develop for the green conceptualized city.&nbsp;</p><p class="MsoNormal" style="line-height: 16.8667px;">This beautifully town surrounded by mother nature, are most visited by nearby Malaysian in recent year. Meanwhile it brought the township popularity and steady increment of population.&nbsp;</p><p class="MsoNormal" style="line-height: 16.8667px;"><br></p><h4 style="line-height: 16.8667px;"><div style="text-align: center;"><i style="color: inherit; font-family: inherit;">In 2015, news releases stated government of Thailand has decided to build an</i></div><i><div style="text-align: center;"><i style="color: inherit; font-family: inherit;">international airport for BETONG for upcoming ASEAN economic community of AEC.&nbsp;</i></div></i></h4><p class="MsoNormal" style="line-height: 16.8667px;"><br></p><p class="MsoNormal" style="line-height: 16.8667px;">It is nearby where the Green ECO Garden City will be located and well developed. Transportation will become worriless since the government foresee the potency of BETONG and decided to have the airport built.&nbsp;</p><p class="MsoNormal" style="line-height: 16.8667px;">There are several unique points and specialty about the project that will embark the project itself become one of the greatest development project in the town.</p><p class="MsoNormal" style="line-height: 16.8667px;"><br></p><p class="MsoNormal" style="line-height: 16.8667px;"><img src="http://ecogreenholding.com/beta/files/summernote/58366a8d35f4e.jpg" style="width: 700px;"><br></p>', '<p class="\\&quot;MsoNormal\\&quot;"><span lang="\\&quot;ZH-CN\\&quot;" style="\\&quot;font-family:&quot;Arial" unicode="" ms";="" mso-fareast-font-family:"arial="" ms";mso-bidi-font-family:"arial="" ms"\\"="">æœ¦èƒ§çš„é›¾æ°”æ€»æ˜¯è½»æ¼«ç¼­ç»•åœ°æ²¿å±±è€ŒçŽ¯ï¼Œå±±ä¸Žå±±é—´åˆå°†å‹¿æ´žè½»æ˜“åœ°å›´å‡ºäº†ä¸€ä¸ªåŸŽå¸‚å±…é—´ã€‚å±žäºŽè¿™ç¯‡åŸŽå¸‚çš„è‡ªç„¶å®é™åœ¨æ¯ä¸€ä¸ªæ™¨æ—©åˆ’ç ´å¤©é™…ï¼Œæ—©æ™¨ä¸­æ¸©æƒ…æ´‹æº¢åœ°æ°›å›´åœ¨äººä¸Žäººæƒ…ä¹‹é—´é…é…¿ï¼Œè€Œè¿™æ ·æš–æ´‹æ´‹çš„å…ƒç´ é€ å°±äº†å±žäºŽå‹¿æ´žçš„åŸŽå¸‚ç‰¹è‰²ã€‚</span><o:p></o:p></p><p class="\\&quot;MsoNormal\\&quot;">&nbsp;<o:p></o:p></p><p class="\\&quot;MsoNormal\\&quot;"><span lang="\\&quot;ZH-CN\\&quot;" style="\\&quot;font-family:&quot;Arial" unicode="" ms";="" mso-fareast-font-family:"arial="" ms";mso-bidi-font-family:"arial="" ms"\\"="">å‹¿æ´žéƒŠå¤–ï¼Œç”±ä¸€æ•´å¤§ç‰‡é«˜ç©ºæœ›ä¸‹æ„Ÿè§‰è½¯ç»µçš„èŒ‚å¯†æ£®æž—è¦†ç›–ã€‚æ¸æ¸åœ°ï¼Œæ¬£èµç€è¿™ä¸ªåŸŽå¸‚ç¾Žçš„äººè¶Šæ¥è¶Šå¤šï¼Œå¸¦å…¥äº†å±žäºŽæ—…æ¸¸ä¸šçš„è“¬å‹ƒç”Ÿæ°”ã€‚</span></p><p class="\\&quot;MsoNormal\\&quot;">&nbsp;<o:p></o:p></p><p class="\\&quot;MsoNormal\\&quot;"><span lang="\\&quot;ZH-CN\\&quot;" style="\\&quot;font-family:&quot;Arial" unicode="" ms";="" mso-fareast-font-family:"arial="" ms";mso-bidi-font-family:"arial="" ms"\\"="">åœ¨</span>2014<span lang="\\&quot;ZH-CN\\&quot;" style="\\&quot;font-family:&quot;Arial" unicode="" ms";mso-fareast-font-family:"arial=