(2, 1, 1, 2, 'Without destruction of a single tree, the project will carry on with a care hand,  and for it will be one of the highlight in the history of the town. ', 'æ•´ä¸ªè¥å»ºè®¡åˆ’å°†åœ¨ä¸ç ´åå¤§è‡ªç„¶ä¸€è‰ä¸€æœ¨çš„ä¸¥è°¨è¿‡ç¨‹ä¸­æ‰§è¡Œï¼Œ è€Œè¿™ä¸€è¥å»ºæ¨¡å¼ä¹Ÿå°†ä¼šä¸ºè¿™ä¸ªåŒºåŸŸå‘å±•ç¼”é€ åŽ†å²ã€‚', '<p>ECO GREEN WELLBEING HOLDING make announcement that the GARDEN CITY project will without damage any natural surrounding and conserve originality of the greenery environment.<br></p><p>The second highlight of the Garden City, the introduction of Mini Windmill technology imported from Korea whereas the size of the mini windmill will generate up to double of common windmill technology.</p><p><img src="http://ecogreenholding.com/beta/files/summernote/58366af5c827b.jpg" style="width: 1578px;"><br></p><p>Both solar and mini wind mill will be taken place fully to generate electricity that can power up the whole city, moreover, a humongous amount of energy saving that will create a total clean and comfy environment for high living quality.</p><p>Other important green infrastructure such as hospital, rain garden systemå®¶åº­å¼é›¨æ°´çŒæº‰ç³»ç»Ÿ, ventilation-designed hospital and community club house with gym center and swimming pool é€é£Žè®¾è®¡å…¬å…±å»ºç­‘, bicycle route track, permeable pavement æ¸—é€æ€§è·¯, urban tree canopy åŸŽå¸‚æ ‘å†  land conservation etc.</p>', '<p class="\\&quot;MsoNormal\\&quot;"><span style="\\&quot;font-family:&quot;Arial" unicode="" ms";mso-fareast-font-family:="" "arial="" ms";mso-bidi-font-family:"arial="" ms"\\"="">ECO GREEN WELLBEING\r\nHOLDING SDN.BHD<span lang="\\&quot;ZH-CN\\&quot;">å·²ç»éƒ‘é‡å¯¹å¤–å®£å¸ƒç»¿åŸŽçš„å¼€å‘å‘å±•å°†ä¿ç•™å‘¨å›´å¤§è‡ªç„¶çš„ç”Ÿæ€ï¼Œå°†ç”Ÿæ€ç»´æŒåœ¨æœ€è‡ªç„¶åŽŸå§‹çŠ¶æ€ä¸­ã€‚</span></span></p><p class="\\&quot;MsoNormal\\&quot;"><span style="\\&quot;font-family:&quot;Arial" unicode="" ms";mso-fareast-font-family:="" "arial="" ms";mso-bidi-font-family:"arial="" ms"\\"=""><span lang="\\&quo