(13, 1, 1, 3, 'Estimated a USD900 million funding for the GARDEN CITY, 3 years upon completion to  create a new green city of example for the rest of the region.', 'æ•´ä¸ªç»¿ç”Ÿæ€å›­åŸŽå°†ç­¹èµ„åˆ°è¾¾9äº¿ç¾Žå…ƒï¼Œä½¿ç”¨3å¹´å…´å»ºï¼Œæˆä¸ºåŒºåŸŸæ€§çš„ä»£è¡¨åŸŽå¸‚ã€‚', '<div>The idea of tourist theme park with estimated size of 3,000,000 sq ft will as well as to implant into the GARDEN CITY, nevertheless the sight of the huge mini wind mill plant, and the theme park will bring in marvelous tourism value and revenue.Â </div><div><br></div><div>First ever Green Theme Park concept cover with large surface on the ground, the idea of Green theme is to serve big tourism and entertainment purpose, meanwhile, to have the visitors understand importance of reservation and protection to our environment. GARDEN CITY aim to create high living quality, facilities to enhance lifestyle included premium golf club, trendy restaurant, big park and playground, spa and relaxation center, medical center, business center and etc.</div><div><br></div><div><br></div><div>In the idea of planning and management for the city, Eco Garden City practice several international standard including restriction of smoking.Â </div><div><br></div><div><br></div><div style="text-align: center; "><i>Free smoke zone is applied, smoking area will be re-segmented. Automobile crossing and entering the city require for smoke-inspection. Fine are meanwhile imposed for natural plants from being broken or destroyed. Environment-care education and campaign will be carried out, a fully plastic-free residential practice and etc, to upgrade the township to become a leading green quality living city. Â </i></div><div style="text-align: center;"><br></div><div><br></div><div>ECO Green City own its govern right in order to protect and manage the environment and living standard. This conceptualized city is a combination of living and tourism, hence it will be the first ever city that held up its membership for visitor to apply to enjoy the recreational services and facilities. The setup for the membership of the city will define the privilege of residents living. Â </div><div><br></div><div><br></div><div style="text-align: center; "><i>Â›If each visitor/member spend USD50 in Betong, it will bring USD7.5 million income every month to the town.</i></div><div style="text-align: center;"><br></div><div><br></div><div>The city has projected reach out 50,000 members holding the ECO GARDEN CITY membership from all around the world by mid of 2017, and 150,000 members at the end of 2017. City revenue will estimated strike up to USD7.5million monthly.Â </div><div><br></div>', '<p class=\\"MsoNormal\\"><span lang=\\"ZH-CN\\" style=\\"font-family:&quot;Arial Unicode MS&quot;;\r\nmso-fareast-font-family:&quot;Arial Unicode MS&quot;;mso-bidi-font-family:&quot;Arial Unicode MS&quot;\\">å¦å¤–ï¼Œç»¿åŸŽå°†å»ºé€ ä¸€ä¸ªå·¨å¤§ä¸ºäººæ¥å¸¦æ¥æ¬¢ä¹çš„ç»¿è‰²ä¸»é¢˜ä¹å›­ï¼Œè¦†ç›–é¢ç§¯åœ¨</span><span style=\\"font-family:&quot;Arial Unicode MS&quot;;mso-fareast-font-family:&quot;Arial Unicode MS&quot;;\r\nmso-bidi-font-family:&quot;Arial Unicode MS&quot;\\">3<span lang=\\"ZH-CN\\">ç™¾ä¸‡å¹³æ–¹å°ºå·¦å³ã€‚å±Šæ—¶ï¼Œä¸ä½†èƒ½å¤Ÿä¸€è§ˆæ•´ä¸ªè¿·ä½ é£ŽåŠ›å‘ç”µç«™çš„é˜”æ™¯ï¼Œä¸»é¢˜ä¹å›­ä¹Ÿå°†ä¸ºå‹¿æ´žå¸¦æ¥åºžå¤§çš„æ—…æ¸¸ä»·å€¼å’Œå•†æœºã€‚</span></span><o:p></o:p></p>\r\n\r\n<p class=\\"MsoNormal\\">&nbsp;<o:p></o:p></p>\r\n\r\n<p class=\\"MsoNormal\\"><span lang=\\"ZH-CN\\" style=\\"font-family:&quot;Arial Unicode MS&quot;;\r\nmso-fareast-font-family:&quot;Arial Unicode MS&quot;;mso-bidi-font-family:&quot;Arial Unicode MS&quot;\\">è¿™å°†ä¼šæ˜¯æœ‰å²ä»¥æ¥é¢ç§¯æœ€å¤§çš„ç»¿è‰²ä¸»é¢˜ä¹å›­ã€‚é™¤äº†æ—…æ¸¸å’Œå¨±ä¹çš„ä»·å€¼ä¹‹å¤–ï¼ŒåŒæ—¶ï¼Œä¹Ÿå¸Œæœ›å¯¹è§‚å…‰ä¸»é¢˜ä¹å›­çš„æ¸¸å®¢ä»¬çŒè¾“æ›´å¤šå…³äºŽä¿è‚²çŽ¯å¢ƒçš„é‡è¦æ€§ã€‚ç»¿åŸŽç«­åŠ›æ‰“é€ çœŸæ­£é«˜å“è´¨çš„å±…ä½çŽ¯å¢ƒï¼ŒåŒ…æ‹¬å»ºé€ å…¬å…±è®¾æ–½æå‡ç”Ÿæ´»æ°´å‡†ï¼Œå½“ä¸­å°±æœ‰é«˜çº§çš„é«˜å°”å¤«çƒåœºï¼Œæ—¶å°šé¤é¥®åŒºï¼Œå¤§å…¬å›­ï¼Œä¼‘é—²åœºæ‰€ï¼ŒåŒ»ç–—è®¾å