(14, 1, 1, 4, 'ECO GARDEN City undoubtedly turn out to be the unique symbol of BETONG. ', 'ç»¿ç”Ÿæ€å›­åŸŽå°†æ— åº¸ç½®ç–‘æˆä¸ºå‹¿æ´žç‹¬ä¸€æ— äºŒçš„æ ‡å¿—æ€§å‘å±•', '<p>The entire city development estimate to launch in mid of 2017, with documentation ready, and construction progress after 3 months of launching.Â </p><p style="text-align: center; "><b><i>A privilege special for our investorÂ </i></b></p><p style="text-align: center; ">EGH investor are entitled to Â free entrance to the Eco Garden City<br>Â›EGH investor are also enjoy certain of discount value for all of the facilities in the city*<br>Â›Â›The housing properties are only open for EGH member</p><h6 style="text-align: center; ">*The discount percentage is depends on the membership level type</h6><p><i>On the other, the company starting to putting on another forecast project target atÂ <br></i><i>another beautiful green piece of land somewhere SABAH.</i></p><p>Sabah has one of the oldest rainforest in the world, located in Borneo island. The deforestation of Sabah is one of the highlight issue in the world environment impact discussion forum. Hence, ECO GREEN WELLBEING HOLDING destined to head light its vision into SABAH, where a green project to be looked forward.</p>', '<p class=\\"MsoNormal\\"><span lang=\\"ZH-CN\\" style=\\"font-family:&quot;Arial Unicode MS&quot;;\r\nmso-fareast-font-family:&quot;Arial Unicode MS&quot;;mso-bidi-font-family:&quot;Arial Unicode MS&quot;\\">æ•´ä¸ªåŸŽå¸‚å‘å±•è®¡åˆ’å°†åœ¨</span><span style=\\"font-family:&quot;Arial Unicode MS&quot;;mso-fareast-font-family:&quot;Arial Unicode MS&quot;;\r\nmso-bidi-font-family:&quot;Arial Unicode MS&quot;\\">2017<span lang=\\"ZH-CN\\">å¹´ä¸­æ—¬æ–‡ä»¶èµ„æ–™å¤„ç†é¢„å¤‡å¥½åŽå¼€å§‹å‘å¸ƒå®žè¡Œï¼Œ</span>3<span lang=\\"ZH-CN\\">ä¸ªæœˆåŽè¿›è¡ŒåŠ¨åœŸä»ªå¼ã€‚</span></span><o:p></o:p></p><p class=\\"MsoNormal\\">&nbsp;<span style=\\"text-align: center;\\">&nbsp;</span></p><p class=\\"MsoNormal\\" align=\\"center\\" style=\\"text-align:center\\